import Div from "./components/Div";

import Form from "./components/Form";
import Header from "./components/Header";
import page from "./components/page";
import Title from "./components/Title";
import Wrapper from "./components/Wrapper";


function App() {
  return(

      <Header>
        <div>
          <a href= "https://youtube.com">
          <img style = {{width: 120, height: 80, borderRadius: 30}} src="https://yt3.ggpht.com/ytc/AAUvwngR3ZPbDMQjeGv4VCMagBrRgL0qpQXJhe9jOxLZuA=s900-c-k-c0x00ffffff-no-rj" alt= "logo botTube"/>
          </a>
        </div>
    <Wrapper>
      <Title  >
        <h1>BotTube</h1>
      </Title>
      <Form>
        <page></page>
      </Form>
      <Div>
      <p style={{marginBottom:15}}>
Consultas de músicas no YouTube © 2021</p>
      </Div>
    </Wrapper>
      </Header>
    ) 




}

export default App;
